import React from "react";
import "./CardParcelleComponent.css"; // Importez votre fichier CSS
import MoreButton from "../../elements/button/MoreButton";

const CardParcelleComponent = () => (
  <div className="card-parcelle-container">
    <div className="background-image-parcelle"></div>
    <div className="text-container-parcelle">
      <div className="rendement-text">Rendement</div>
      <div className="id-parcelle-text">ID Parcelle</div>
      <div className="types-cultures-text">Types de cultures : - -</div>
    </div>
    <MoreButton/>
  </div>
);

export default CardParcelleComponent;
